import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  SettingToggle,
  Stack,
  TextField,
  TextStyle,
} from '@shopify/polaris';
import { handleSubmit } from "../trade/trades/src/test.js"

class AnnotatedLayout extends React.Component {
  render() {

    //console.log(handleSubmit)
    return (
      <Layout.AnnotatedSection
      title="Check exchange rates"
      description="Select your currency and amount to insure, we will give you our exchange rate rate instantly."
      >
        <Card sectioned>
          <Form onSubmit={handleSubmit}>
            <FormLayout>
              <TextField
                label="Currency"
                type="currency"
              />
              <TextField
                label="Amount"
                type="amount"
              />
              <Stack distribution="trailing">
                <Button submit>
                  Check
                </Button>
              </Stack>
            </FormLayout>
          </Form>
        </Card>
      </Layout.AnnotatedSection>
    );
  }

  // handleSubmit = () => {
  //   //console.log('website server running');
  //  // let request_bid_ask = require('../trade/trades/src/request_bid_ask')
  //   //var price = request_bid_ask.request_bid_ask()
  //   //var price = request_bid_ask.request_bid_ask();
  //   //setTimeout(function(){ console.log('Guaranteed exchange rate is ',price)}, 2000);
  //   //console.log('Guaranteed exchange rate is ')
  // };
}

export default AnnotatedLayout;
